import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { API_URL } from '../config';
import '../styles/HomePage.css';

const HomePage = () => {
  const [featuredProducts, setFeaturedProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await fetch(`${API_URL}/api/products?limit=6`);
        const data = await response.json();
        if (!response.ok) {
          throw new Error(data.error || 'Failed to fetch products');
        }
        setFeaturedProducts(data.products);
      } catch (error) {
        setError('Failed to load products. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchProducts();
  }, []);

  const clothingCategories = [
    { name: "Men's Clothing", image: "https://via.placeholder.com/300x200?text=Men's+Clothing" },
    { name: "Women's Clothing", image: "https://via.placeholder.com/300x200?text=Women's+Clothing" },
    { name: "Accessories", image: "https://via.placeholder.com/300x200?text=Accessories" }
  ];

  return (
    <div className="home-page">
      {/* Hero Section */}
      <div className="hero-section">
        <div className="hero-content">
          <h1>Welcome to Thrift Store</h1>
          <p>Discover amazing deals on pre-loved clothing</p>
          <Link to="/products" className="browse-button">
            Browse Products
          </Link>
        </div>
      </div>

      {/* Featured Products */}
      <section className="featured-section">
        <h2>Featured Products</h2>
        {loading ? (
          <div className="loading-spinner"></div>
        ) : error ? (
          <div className="error-message">{error}</div>
        ) : (
          <div className="products-grid">
            {featuredProducts.map((product) => (
              <Link to={`/products/${product._id}`} key={product._id} className="product-card">
                <div className="product-image">
                  <img 
                    src={product.images[0] || "https://via.placeholder.com/300x300?text=No+Image"} 
                    alt={product.name} 
                  />
                </div>
                <div className="product-info">
                  <h3>{product.name}</h3>
                  <p className="price">${product.price}</p>
                  <p className="condition">{product.condition}</p>
                </div>
              </Link>
            ))}
          </div>
        )}
      </section>

      {/* Categories */}
      <section className="categories-section">
        <h2>Shop by Category</h2>
        <div className="categories-grid">
          {clothingCategories.map((category) => (
            <Link 
              to={`/products?category=${encodeURIComponent(category.name)}`} 
              key={category.name} 
              className="category-card"
            >
              <img src={category.image} alt={category.name} />
              <h3>{category.name}</h3>
            </Link>
          ))}
        </div>
      </section>

      {/* Call to Action */}
      <section className="cta-section">
        <div className="cta-content">
          <h2>Have items to sell?</h2>
          <p>Turn your pre-loved clothing into cash</p>
          <Link to="/sell" className="sell-button">
            Start Selling
          </Link>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
